// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Імпорт необхідних бібліотек
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TRON is ERC20, Ownable {
    AggregatorV3Interface internal priceFeed; // Інтерфейс для отримання ціни з Chainlink
    uint256 public tokenPrice; // Ціна токену в USD (або іншій валюті)
    string private tokenImageURL; // URL зображення токену

    // Конструктор контракту
    constructor() ERC20("USDTALEX", "TRX") Ownable(msg.sender) {
        tokenPrice = 1 * 10**18; // Початкова ціна токену (наприклад, 1 USD)
        priceFeed = AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419); // Адреса Chainlink Oracle (замініть на реальну)
        _mint(msg.sender, 1000000 * 10**decimals()); // Мінт початкової кількості токенів
    }

    // Функція для оновлення ціни токену з Chainlink
    function updateTokenPrice() public {
        int price = getPrice(); // Отримання ціни з Chainlink
        require(price > 0, "Invalid price"); // Перевірка, що ціна коректна
        tokenPrice = uint256(price); // Оновлення ціни токену
    }

    // Функція для отримання ціни з Chainlink
    function getPrice() public view returns (int) {
        (
            /* uint80 roundID */,
            int price,
            /* uint startedAt */,
            /* uint timeStamp */,
            /* uint80 answeredInRound */
        ) = priceFeed.latestRoundData(); // Отримання даних з Oracle
        return price;
    }

    // Функція для встановлення URL зображення токену (тільки для власника)
    function setTokenImageURL(string memory _url) public onlyOwner {
        tokenImageURL = _url;
    }

    // Функція для отримання URL зображення токену
    function getTokenImageURL() public view returns (string memory) {
        return tokenImageURL;
    }
}
